var tipuesearch = {"pages": [{'title': '關於', 'text': '\n 個人網站 \n 個人資料庫 \n \n 階段1 \n stage1-ag22網站 \n stage1-ag22資料庫 \n \n 第二階段 \n Stage2-ag2網站 \n Stage2-ag2存儲庫 \n \n 第三階段 \n stage3-ag2網站 \n stage3-ag2資料庫 \n \n \n', 'tags': '', 'url': '關於.html'}, {'title': '階段1', 'text': '黃翊銘的網站 \n 黃翊銘的倉儲 \n 陳冠宇的網站 \n 陳冠宇的倉儲 \n 舞台ag22的網站 \n 舞台ag22的倉儲 \n', 'tags': '', 'url': '階段1.html'}, {'title': '第1週', 'text': '產品主題 \n “ 多功能變型家具\xa0 ” \n 設計理念： \n 由於現在台灣地價飆升，百姓的生活空間受到壓迫，為了替代的節省空間，我們才想說做一個可以變形和方便收納的多功能變形家具。 \n 我們最後選擇將椅子和桌子融合在一起，因為對於大學生來說要租到一間便宜，空間又大的房間，是可遇不可求的，魚和熊掌不可兼得的道理，基本上很難能兩全其美，所以既然空間不夠，那就將不必要的物品收起來，經過我們調查，很多時候我們其實只用的到一樣東西，不會同時需要使用，所以當今天有同學來家裡聊天就可以搬出我們設計的這款多功能變型家具，變成椅子讓客人坐，要是要做學術討論，將椅子變桌子一起討論，要是不用時又可以變成裝置藝術，簡直是一舉三得的好產品阿~~(✿◕‿◕✿) \n 第一次大改版 : \n \n', 'tags': '', 'url': '第1週.html'}, {'title': 'week2', 'text': '第一次的產品設計 : \n 本次設計的理念最主要是以 實用 為主，其次為 可行性 。因此往傢俱的方向去構思， \n 似乎是個不錯的想法？ \n 最近看到摺疊傢俱豐富多變，設計一個具備兩種功能的傢俱，以實用性來說非常不錯。 \n 一開始用google meeting討論雛形，組員各自畫出自己的想法，將想法合併，探討其 \n 中是否存在衝突或是錯誤。 \n \n \n 我們的想法是:把一張椅子變形成桌子，藉由摺疊的方式，自由變換型態。 \n 中間遇到最大的問題是桌面的拼接方式以及中間的接合處間隙，我們從5種拼接方式中選擇 \n 最合適且最好設計的形狀(在第三周顯示)，再來設計尺寸。 \n', 'tags': '', 'url': 'week2.html'}, {'title': 'week3', 'text': '\n \n 上圖為本次設計結果 \n \n 經過一周的討論以及想法結合，成品已擬定完成，接著就是建模與組立。 \n 總共有12個零件，以下為各零件之視圖: \n 第一件:支架中心 \n \n 第二件:連桿公件 \n \n 第三件:連桿母件 \n \n 第四件:接頭 \n \n 第五件:短銷 \n \n 第六件:長銷 \n \n 第七件:滑塊 \n \n 第八件:桌板 \n \n 第九件:桌板 \n 設計成鳩尾槽的形式 \n \n 第十件:主樑 \n \n 第十一件:主樑 \n \n 第十二件:螺釘(ISO M2x5) \n \n 展開後的各個角度: \n \n \n \n 桌面的拼接方式: \n 從畫圈處看到，我們以錯開的方式接合 \n \n 支架合體&展開: \n 連桿座之間的角度30度和60度，從上視圖看。 \n \n \n \n \n \n', 'tags': '', 'url': 'week3.html'}, {'title': 'week4', 'text': '', 'tags': '', 'url': 'week4.html'}, {'title': 'simulation-1', 'text': '產品設計完後，使其做動是必要的設計環節之一，利用inventor內的動畫功能使其合體及展開。 \n 並錄製彩現動畫，兼具美觀且一目了然。 \n 整體做動影片: \n \n \n 支架展開&收合: \n', 'tags': '', 'url': 'simulation-1.html'}, {'title': 'Color & Light and shadow', 'text': '將組合好的零件用Keyshot上色，將零件加入材質、放上展示台 、打光、調整陰影、調整角度，加入背景， \n 最後輸出。 \n \n \n 合體 \n \n \n \n 展開 \n \n \n', 'tags': '', 'url': 'Color & Light and shadow.html'}, {'title': 'Stage 2', 'text': 'Stage2-ag2 website \n \n', 'tags': '', 'url': 'Stage 2.html'}, {'title': 'week5', 'text': '先擬定第二次的主題方向。 \n 在課堂上討論的最終結果是 變速箱 ，設計三段變速，外加一個 N 檔。 \n \n 心得 \n \xa0 \xa0 第二次的專題與新夥伴合作，在討論的過程中，你一來我一往，彼此的意見交流，雖然有時會出現意見 \n 分歧，但互相提出自己的主見，從中達成共識進而 促進團隊合作的精神。而這次合作對象非常厲害，目前合 \n 作起 來很愉快，感覺會有不錯的成果。 \n', 'tags': '', 'url': 'week5.html'}, {'title': 'week6', 'text': '繪圖與討論 \n \n \n \n \n \n', 'tags': '', 'url': 'week6.html'}, {'title': 'experience-1', 'text': '從網路上找到相關資料，與組員進行設計與繪製，其中花費最久的部分是尺寸設計與配合，因為都是憑空想像，所以公差上的設計會格外麻煩，但都解決了。 \n \n', 'tags': '', 'url': 'experience-1.html'}, {'title': 'week7', 'text': '', 'tags': '', 'url': 'week7.html'}, {'title': 'Q&A', 'text': '用CoppeliaSim模擬機構作動。 \n 在模擬過程有遇到幾個問題: \n 1.模擬時，動畫跑得很遲鈍如當機一般。 \n 解決辦法: \n 紅框內的三個方框從左到右分別是引擎、狀態、效能 \n \n \n 第一個方框選擇 Newton的引擎(牛頓:較符和機構作動；若選擇Bullet會很卡，因為Bullet大部分是在模擬遊戲動畫的) \n \n 第二個方框選 Fast \n \n 第三個方框選 dt=50ms \n \n \n 2.模擬太過精密的零件無法正常作動 \n 解決辦法: 無， CoppliaSim無法模擬太精密的東西。 \n \n', 'tags': '', 'url': 'Q&A.html'}, {'title': 'experience-2', 'text': '零件繪製完成並載入CoppeliaSim模擬。模擬過程遇到許多問題，例如:運轉不順、間隙過小、模擬結果不如預期想像...等，之後都有想到對策。 \n \n', 'tags': '', 'url': 'experience-2.html'}, {'title': 'week8', 'text': '', 'tags': '', 'url': 'week8.html'}, {'title': 'simulation-2', 'text': '各檔位的模擬情況 \n 各檔位的齒比: \n 1檔50齒/ 14齒≒3.571 \n 2檔45齒/ 19齒 ≒2.368 \n 3檔39齒/ 25齒 ≒1.56 \n 4檔32齒/ 32齒 ≒1 \n 5檔31齒/ 33齒 ≒0.939 \n R檔38齒/ 12齒 ≒3.167 \n \xa0 \xa0 \xa0 慣輪齒比：16齒/ 14齒≒1.143 \n 輸出端齒比30齒：34齒 ≒0.882 \n \n \n 同步齒的接合狀況， 將零件淡化觀察細部。 \n \n 檔案連結： 總檔案 \n \n', 'tags': '', 'url': 'simulation-2.html'}, {'title': '色彩與光影', 'text': '\n \n \n \n \n \n', 'tags': '', 'url': '色彩與光影.html'}, {'title': '經驗-1', 'text': '原本的排檔桿是多連桿結構，但模擬上遇到許多困難，例如：牽涉到Z軸的問題，球面零件的自由度太高，模擬困難...等，所以改成單支以利模擬，雖然有些單調，但功能一切正常。 \n \n', 'tags': '', 'url': '經驗-1.html'}, {'title': '第9週', 'text': '', 'tags': '', 'url': '第9週.html'}, {'title': '經驗-2', 'text': '段考週能整理的時間縮短了，雖然基本上上都完工了，還是有一些細節還要再調整，但時間已所剩無幾，先將必要的部分趕工出來為優先，否則顧此失彼就不好了。 \n \n', 'tags': '', 'url': '經驗-2.html'}, {'title': '第三階段', 'text': '', 'tags': '', 'url': '第三階段.html'}, {'title': '週10', 'text': '建分組網站＆討論 \n \n', 'tags': '', 'url': '週10.html'}, {'title': '第11週', 'text': '\n', 'tags': '', 'url': '第11週.html'}, {'title': '週12', 'text': '\n', 'tags': '', 'url': '週12.html'}, {'title': '週13', 'text': '\n', 'tags': '', 'url': '週13.html'}, {'title': '週14', 'text': '\n', 'tags': '', 'url': '週14.html'}, {'title': '問題解決', 'text': '', 'tags': '', 'url': '問題解決.html'}, {'title': '任務1', 'text': '讀取 \xa0 stage3_2a.txt , 建立 Stage3 的分組倉儲, 分組網頁, 以及各組員倉儲及網頁連結. \n 老師的範例 : \n # open file, default is read mode, since txt content no chinese char\n# no encoding = "UTF-8" is needed\nwith open("stage3_2a.txt") as fh:\n    # readlines will read into the whole line and put into list format\n    # has \\n at the end of each line\n    data = fh.readlines()\n#print(len(data))\nfor i in range(len(data)):\n    group = data[i].rstrip("\\n").split("\\t")\n    print(group)\n# the following will use group data to generate needed html \n \n 第一版 :將學號按組別排好 \n with open("stage3_2a.txt") as fh:\n   #先將我們存起來stage3_2a.txt打開並命名為fh\n    data = fh.readlines()\n    #將stage3_2a.txt的資料以串列形式存為data\nfor i in range(len(data)):\n    group = data[i].rstrip("\\n").split("\\t")\n    #先取出data list中的第i項,消除元素中/n,再以\\t取出需要的文字\n    print(group[0]+\'|\'+group[0])\n    #先將group第0列推出\n    for j in range(1,18,1):\n    #設一個範圍,(1到18,每次加1,1<=j<18)\n        try:\n            print(group[j])\n        except:\n           continue\n        #這邊使用try.....except,因為有一組6個人,導致有空格,所以需要用continue讓迴圈繼續跑 \n \n \n 第二版 :將40823122的學號修正 \n with open("stage3_2a.txt") as fh:\n   #先將我們存起來stage3_2a.txt打開並命名為fh\n    data = fh.readlines()\n    #將stage3_2a.txt的資料以串列形式存為data\nfor i in range(len(data)):\n    newdata = data[i].replace(\'4823122\',\'40823122\')\n    #因為40823122的學號打錯了,所以用 replace 把舊的替換成新的\n    group = newdata.rstrip("\\n").split("\\t")\n    #先取出newdata list中的第i項,消除元素中/n,再以\\t取出需要的文字\n    print(group[0]+\'|\'+group[0])\n    #先將group第0列推出\n    for j in range(1,18,1):\n    #設一個範圍,(1到18,每次加1,1<=j<18)\n        try:\n            print(group[j])\n        except:\n           continue\n        #這邊使用try.....except,因為有一組6個人,導致有空格,所以需要用continue讓迴圈繼續跑 \n \n \n 第三版 :以網頁的形式推出,但會告知 \n print(\'<p>\'+group[0]+\' | <a href="https://\'+group[1]+\'.github.io/\'+group[0]+\'">Website</a> | <a href="https://github.com/\'+group[2]+\'/\'+group[0]+\'">Repository</a></p>\') IndexError: list index out of range \n with open("stage3_2a.txt") as fh:\n   #先將我們存起來stage3_2a.txt打開並命名為fh\n    data = fh.readlines()\n    #將stage3_2a.txt的資料以串列形式存為data\nfor i in range(len(data)):\n    newdata = data[i].replace(\'4823122\',\'40823122\')\n    #因為40823122的學號打錯了,所以用 replace 把舊的替換成新的\n    group = newdata.rstrip("\\n").split("\\t")\n    #先取出newdata list中的第i項,消除元素中/n,再以\\t取出需要的文字\n    print(\'<p>\'+group[0]+\' | <a href="https://\'+group[1]+\'.github.io/\'+group[0]+\'">Website</a> | <a href="https://github.com/\'+group[2]+\'/\'+group[0]+\'">Repository</a></p>\')\n    for j in range(1,18,2):\n    #設一個範圍,(1到18,每次+2,1<=j<18)\n        try:\n            print(\'<p>\'+group[j]+\' | Website:\'+\'<a href="https://\'+group[j]+\'.github.io/cd2021\'+\'">\'+group[j]+\'</a>\'+\' | Repository:\'+\'<a href="https://github.com/\'+group[j]+\'/cd2021\'+\'">\'+group[j]+\'</a> </p>\')\n        except:\n           continue\n        #這邊使用try.....except,因為有一組6個人,導致有空格,所以需要用continue讓迴圈繼續跑\n \n \n \n 第四版 :將a40823112和stage3_ag修正 \n with open("stage3_2a.txt") as fh:\n   #先將我們存起來stage3_2a.txt打開並命名為fh\n    data = fh.readlines()\n    #將stage3_2a.txt的資料以串列形式存為data\nfor i in range(6):\n    #將次數限定就不會告知list index out of range了\n    newdata1 = data[i].replace(\'4823122\',\'40823122\')\n    #因為40823122的學號打錯了,所以用 replace 把舊的替換成新的\n    newdata2 = newdata1.replace(\'\\t\\t\',\'\')\n    #因為有一組只有6人,所以用 replace 把空位刪除\n    newdata3 = newdata2.replace(\'_\',\'-\')\n    #因為在編輯txt的時候-會變成_,所以用 replace 把_修正為-\n    group = newdata3.rstrip("\\n").split("\\t")\n    #先取出newdata list中的第i項,消除元素中/n,再以\\t取出需要的文字\n    print(\'<p>\'+group[0]+\' | <a href="https://\'+group[1]+\'.github.io/\'+group[0]+\'">Website</a> | <a href="https://github.com/\'+group[2]+\'/\'+group[0]+\'">Repository</a></p>\')\n    for j in range(1,18,2):\n    #設一個範圍,(1到18,每次+2,1<=j<18)\n        try:\n            n = group[j].replace(\'40823112\',\'a40823112\')\n            #因為40823112的github帳號是a40823112,所以用 replace 把帳號修正\n            print(\'<p>\'+group[j]+\' | Website:\'+\'<a href="https://\'+n+\'.github.io/cd2021\'+\'">\'+group[j]+\'</a>\'+\' | Repository:\'+\'<a href="https://github.com/\'+n+\'/cd2021\'+\'">\'+group[j]+\'</a> </p>\')\n        except:\n           continue\n        #這邊使用try.....except,因為有一組6個人,導致有空格,所以需要用continue讓迴圈繼續跑 \n \n \n 第五版 :將連結以老師常用的形式推出 \n with open("stage3_2a.txt") as fh:\n   #先將我們存起來stage3_2a.txt打開並命名為fh\n    data = fh.readlines()\n    #將stage3_2a.txt的資料以串列形式存為data\nfor i in range(6):\n    #將次數限定就不會告知list index out of range了\n    newdata1 = data[i].replace(\'4823122\',\'40823122\')\n    #因為40823122的學號打錯了,所以用 replace 把舊的替換成新的\n    newdata2 = newdata1.replace(\'\\t\\t\',\'\')\n    #因為有一組只有6人,所以用 replace 把空位刪除\n    newdata3 = newdata2.replace(\'_\',\'-\')\n    #因為在編輯txt的時候-會變成_,所以用 replace 把_修正為-\n    group = newdata3.rstrip("\\n").split("\\t")\n    #先取出newdata list中的第i項,消除元素中/n,再以\\t取出需要的文字\n    print(\'<p><a href="https://github.com/\'+group[1]+\'/\'+group[0]+\'">\'+group[0]+\' repo</a> | <a href="https://\'+group[2]+\'.github.io/\'+group[0]+\'">\'+group[0]+\' site</a></p>\')\n    for j in range(1,18,2):\n    #設一個範圍,(1到18,每次+2,1<=j<18)\n        try:\n            n = group[j].replace(\'40823112\',\'a40823112\')\n            #因為40823112的github帳號是a40823112,所以用 replace 把帳號修正\n            print(\'<p>\'+\'<a href="https://github.com/\'+n+\'/cd2021">\'+group[j]+\' repo</a> | <a href="https://\'+n+\'.github.io/cd2021">\'+group[j]+\' site</a></p>\')\n        except:\n           continue\n        #這邊使用try.....except,因為有一組6個人,導致有空格,所以需要用continue讓迴圈繼續跑\n \n \n 參考資料: \n python 語法 renge \n python 基本語法 \n python loop 原理 \n \xa0 \n \n', 'tags': '', 'url': '任務1.html'}, {'title': '任務2', 'text': '\n \n \n', 'tags': '', 'url': '任務2.html'}, {'title': '任務3', 'text': '\xa0 \n \n \n \n', 'tags': '', 'url': '任務3.html'}, {'title': '科普利亞·西姆', 'text': '我們將每個齒輪都加一個關節，並配合好速度去模擬作動。 \n \n \xa0 \n \n \n', 'tags': '', 'url': '科普利亞·西姆.html'}]};